import React from "react";
import '../style.css';

export const AboutMe = () => {
    return (
        <div className="AboutMe">
            <div  className="cards">
                <div>
                    <div className="contentBox1"></div>
                    <div className="contentBox2"></div>
                    <div className="contentBox3"></div>
                </div>
            </div>
        </div>
    )
}
